import React, {useState} from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const EditUserList = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    // Check if location.state and dataItem exist
    const dataItem = location.state?.dataItem;    
    const navigate = useNavigate();

    const backManageDevice = () => {
        navigate('/superadmin/ManageUsers');
    };

     // Edit users
     const [username, setUserName] = useState(dataItem?.username || '');
     const [phone_no, setPhoneNumber] = useState(dataItem?.phone_no || '');
     const [email_id, setEmailID] = useState(dataItem?.email_id || '');
     const [password, setPassword] = useState(dataItem?.password || '');
     const [status, setStatus] =useState(dataItem?.charger_id || '');
     const [wallet_bal, setWallet] =useState(dataItem?.wallet_bal || '');
     const [errorMessage, setErrorMessage] = useState(dataItem?.charger_id || '');

     const editManageUser = async (e) => {
         alert(  JSON.stringify({ user_id: username, phone_no, password, wallet_bal, status,modified_by:userInfo.email_id }), 'add charger all data' );
         e.preventDefault();
         try {
             const response = await fetch('/superadmin/UpdateUser', {
             method: 'POST',
             headers: {
                 'Content-Type': 'application/json',
             },
             body: JSON.stringify({ username, phone_no, password, wallet_bal, status, modified_by:userInfo.email_id }),
             });
             alert(  JSON.stringify({ username, phone_no, password, wallet_bal, status, modified_by:userInfo.email_id }), 'add charger all data' );
             if (response.ok) {
                 alert('Charger added successfully');
                 // Clear the input after successful submission if needed
                 setUserName(''); 
                 setPhoneNumber(''); 
                 setEmailID(''); 
                 setPassword(''); 
                 setWallet('');
             } else {
                 setErrorMessage('Failed to add charger');
             }
         }catch (error) {
             setErrorMessage('An error occurred while adding the charger');
             console.error('Error:', error);
         }
     };  
    return (
        <div className='container-scroller'>
            {/* Header */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Edit User List</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageDevice}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-12 grid-margin">
                                            <div class="card">
                                                <div class="card-body">
                                                    <h4 class="card-title">Manage User</h4>
                                                    <form class="form-sample" onSubmit={editManageUser}>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">User Name</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="User Name" value={username}  onChange={(e) => setUserName(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Phone Number</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Phone Number" pattern="[0-9]{10}" value={phone_no} onChange={(e) => setPhoneNumber(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Email ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="email" class="form-control" placeholder="Email ID" value={email_id}  onChange={(e) => setEmailID(e.target.value)} readOnly required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Password</label>
                                                                    <div class="col-sm-9">
                                                                        <textarea type="text" class="form-control" placeholder="Password" value={password} maxLength={150} onChange={(e) => setPassword(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Wallet</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Wallet" value={wallet_bal}  onChange={(e) => setWallet(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Status</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Status" value={status}  onChange={(e) => setStatus(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
